import React, { useEffect } from "react";
import { gsap } from "gsap";
import { ScrollTrigger } from "gsap/ScrollTrigger"; // Import ScrollTrigger
import "./Footer.css";

gsap.registerPlugin(ScrollTrigger); // Enregistrer le plugin

const Footer = () => {
  useEffect(() => {
    // Animation pour la section "about-section" au défilement
    gsap.from(".about-section", {
      opacity: 0,
      y: 50,
      duration: 1,
      scrollTrigger: {
        trigger: ".about-section",
        start: "top 80%", // Commence quand l'élément est à 80% de la hauteur de la fenêtre
        end: "top 50%", // Fin de l'animation
        scrub: true, // Animation fluide en fonction du défilement
      }
    });

    // Animation pour les liens de la "links-section"
    gsap.from(".links-section .link", {
      opacity: 0,
      x: -50,
      stagger: 0.1, // Espacement entre les animations
      duration: 1,
      scrollTrigger: {
        trigger: ".links-section",
        start: "top 80%",
        end: "top 50%",
        scrub: true,
      }
    });

    // Animation pour la section "register-section"
    gsap.from(".register-section", {
      opacity: 0,
      y: 50,
      duration: 1,
      scrollTrigger: {
        trigger: ".register-section",
        start: "top 80%",
        end: "top 50%",
        scrub: true,
      }
    });

    // Animation pour la barre du bas "footer-bottom"
    gsap.from(".footer-bottom", {
      opacity: 0,
      y: 30,
      duration: 0.8,
      scrollTrigger: {
        trigger: ".footer-bottom",
        start: "top 80%",
        end: "top 50%",
        scrub: true,
      }
    });

  }, []);

  return (
    <footer className="footer">
      <div className="footer-top">
        <div className="about-section">
          <h3 className="logo">Artizal</h3>
          <p className="about-text">
            The first Moroccan platform linking manufacturers and craftsmen with marketers worldwide, streamlining the e-commerce process to empower local products and provide exceptional customer experiences.
          </p>
          <p className="contact">
            Got Questions? Call us 24/7 <br />
            <strong>(+212) 06 62 62 53 83</strong>
          </p>
        </div>

        <div className="links-section">
          <h4 className="section-title">Useful Links</h4>
          <ul className="links-list">
            <li><a href="#" className="link">Home</a></li>
            <li><a href="#" className="link">About</a></li>
            <li><a href="#" className="link">Brand & Drop</a></li>
            <li><a href="#" className="link">Sell on Artizal</a></li>
            <li><a href="#" className="link">Contact</a></li>
            <li><a href="#" className="link">FAQ</a></li>
          </ul>
        </div>

        <div className="register-section">
          <h4 className="section-title">Register</h4>
          <p className="register-text">
            What are you waiting for to start your e-commerce journey?
          </p>
          <button className="register-button">Sell on Artizal</button>
          <div className="social-icons">
            <a href="#" className="icon">🌐</a>
            <a href="#" className="icon">📘</a>
            <a href="#" className="icon">📸</a>
            <a href="#" className="icon">🎥</a>
          </div>
        </div>
      </div>
      <div className="footer-bottom">
        <p>© 2025 Artizal. All Rights Reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
